package org.example.model;import jakarta.persistence.*;@Table@Entity(name="account")public class Account {    @Id    @Column(name="accountNumber")    private String accountNumber;    @Column(name="firstName")    private String firstName;    @Column(name="lastName")    private String lastName;    @Column(name="address")    private String address;    @Column(name="age")    private int age;    @Column(name="fatherName")    private String fatherName;    @Column(name="motherName")    private String motherName;    @Column(name="aadharNo")    private String aadharNo;    @Column(name="panNo")    private String panNo;    @Column(name="mobileNo")    private String mobileNo;    @Column(name="amount")    private int amount;    @Column(name="branchCode")    private String branchCode;    public String getAccountNumber() {        return accountNumber;    }    public void setAccountNumber(String accountNumber) {        this.accountNumber = accountNumber;    }    public String getFirstName() {        return firstName;    }    public void setFirstName(String firstName) {        this.firstName = firstName;    }    public String getLastName() {        return lastName;    }    public void setLastName(String lastName) {        this.lastName = lastName;    }    public String getAddress() {        return address;    }    public void setAddress(String address) {        this.address = address;    }    public int getAge() {        return age;    }    public void setAge(int age) {        this.age = age;    }    public String getFatherName() {        return fatherName;    }    public void setFatherName(String fatherName) {        this.fatherName = fatherName;    }    public String getMotherName() {        return motherName;    }    public void setMotherName(String motherName) {        this.motherName = motherName;    }    public String getAadharNo() {        return aadharNo;    }    public void setAadharNo(String aadharNo) {        this.aadharNo = aadharNo;    }    public String getPanNo() {        return panNo;    }    public void setPanNo(String panNo) {        this.panNo = panNo;    }    public String getMobileNo() {        return mobileNo;    }    public void setMobileNo(String mobileNo) {        this.mobileNo = mobileNo;    }    public int getAmount() {        return amount;    }    public void setAmount(int amount) {        this.amount = amount;    }    public String getBranchCode() {        return branchCode;    }    public void setBranchCode(String branchCode) {        this.branchCode = branchCode;    }}